import React from 'react';

const Country = ({ country }) => {
  return (
    console.log(country),
    (
      <div className='card'>
        <div className='row'>
          <div className='col-md-6'>
            <img src={country.flag} alt={country.name} />
          </div>
          <div className='col-md-6'></div>
        </div>
      </div>
    )
  );
};

export default Country;
